@Entity
public class Video {
    @Id @GeneratedValue(strategy = GenerationType.IDENTITY)
    private Long id;
    private String title;
    private String url;
    private int likes = 0;
    private boolean favorite = false;

    public Long getId() {
        return id;
    }

    public boolean isFavorite() {
        return favorite;
    }

    public void setFavorite(boolean favorite) {
        this.favorite = favorite;
    }

    public int getLikes() {
        return likes;
    }

    public void setLikes(int likes) {
        this.likes = likes;
    }

    public String getUrl() {
        return url;
    }

    public void setUrl(String url) {
        this.url = url;
    }

    public String getTitle() {
        return title;
    }

    public void setTitle(String title) {
        this.title = title;
    }

    public void setId(Long id) {
        this.id = id;
    }

import org.springframework.context.annotation.Bean;
import org.springframework.context.annotation.Configuration;
import io.swagger.v3.oas.models.OpenAPI;
import io.swagger.v3.oas.models.info.Info;

@Configuration
public class OpenApiConfig {

    @Bean
    public OpenAPI customOpenAPI() {
        return new OpenAPI()
            .info(new Info().title("Playlist API").version("1.0").description("API del proyecto Playlist - UM"));
    }

import org.springframework.security.test.context.support.WithMockUser;

@WebMvcTest(VideoRestController.class)
@WithMockUser(username = "devuser", roles = {"USER"})
class VideoRestControllerTest {
    @Autowired MockMvc mvc;
    @MockBean VideoService service;

    @Test
    void getNotFound() throws Exception {
        when(service.find(999L)).thenReturn(Optional.empty());
        mvc.perform(get("/api/videos/999"))
                .andExpect(status().isNotFound());
    }

    @Test
    void getOk() throws Exception {
        Video v = new Video();
        v.setId(1L); v.setTitle("t"); v.setUrl("u");
        when(service.find(1L)).thenReturn(Optional.of(v));
        mvc.perform(get("/api/videos/1"))
                .andExpect(status().isOk())
                .andExpect(jsonPath("$.title").value("t"));
    }
}
